private void removeEmptyKeys(
    Map<Set<String>, PlacementConstraint> constraintMap) {
  Iterator<Set<String>> iter = constraintMap.keySet().iterator();
  while (iter.hasNext()) {
    Set<String> aTags = iter.next();
    if (aTags.size() == 0) {
      iter.remove();
    }
  }
}
